webpackJsonp([0x75425e62a8c6],{1248:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2016-05-21-maker-faire/index.md absPath of file >>> MarkdownRemark",html:'<p>After a week with the Google tech elite today was a day dedicated to fun, curiosity and fascination. Callie brought Devin down Yesterday so we could spend today experiencing the inventions of the Bay Area\'s eccentric, creative, technology minds.</p>\n<p>I\'m not sure how to describe Maker Faire. There are vendors selling everything from small CNC machines to youth groups with kits. There were more 3D printers than I could count including one about 20 feet tall that could print some truely monumental sculptures.</p>\n<div class="post-images">\n  <a href="giant_3D_printer.jpg">\n  <a class="gatsby-resp-image-link" href="/static/giant_3D_printer_sm-971c2129f0ae5d668166d57932b791c1-f8e2c.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 225px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="giant 3D printer" title="" src="/static/giant_3D_printer_sm-971c2129f0ae5d668166d57932b791c1-f8e2c.jpg" srcset="/static/giant_3D_printer_sm-971c2129f0ae5d668166d57932b791c1-1e460.jpg 163w,\n/static/giant_3D_printer_sm-971c2129f0ae5d668166d57932b791c1-f8e2c.jpg 225w" sizes="(max-width: 225px) 100vw, 225px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n</div>\n<p>There were classes on how to grow from mushrooms and a truck converted into a mobile green house. There were sculptures that spewed fire, a Tesla with panels that lit up like a zebra and a giant forest of lit up inflatable astro-flower things. It was pretty cool.</p>\n<div class="post-images">\n  <a href="justin_callie.jpg">\n  <a class="gatsby-resp-image-link" href="/static/justin_callie_sm-044ef597084e6b381e72c3aee4e5c5ee-d5f0e.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="justin and callie" title="" src="/static/justin_callie_sm-044ef597084e6b381e72c3aee4e5c5ee-d5f0e.jpg" srcset="/static/justin_callie_sm-044ef597084e6b381e72c3aee4e5c5ee-a0a20.jpg 163w,\n/static/justin_callie_sm-044ef597084e6b381e72c3aee4e5c5ee-d5f0e.jpg 300w" sizes="(max-width: 300px) 100vw, 300px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n  <a href="forest.jpg">\n  <a class="gatsby-resp-image-link" href="/static/forest_sm-d3c2ec0d8bf3865b57ce0f18ffe113e2-f8e2c.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 225px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="forest" title="" src="/static/forest_sm-d3c2ec0d8bf3865b57ce0f18ffe113e2-f8e2c.jpg" srcset="/static/forest_sm-d3c2ec0d8bf3865b57ce0f18ffe113e2-1e460.jpg 163w,\n/static/forest_sm-d3c2ec0d8bf3865b57ce0f18ffe113e2-f8e2c.jpg 225w" sizes="(max-width: 225px) 100vw, 225px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n</div>\n<p>There was a <a href="http://www.strandbeest.com/">StrandBeest</a> which is amazing to see in person:</p>\n<div class="post-images">\n<iframe width="560" height="315" src="https://www.youtube.com/embed/BHqZEfTWhOo" frameborder="0" allowFullScreen></iframe>\n</div>\n<p>The R2D2 club was on hand to show off the droids we\'ve all been looking for:</p>\n<div class="post-images">\n  <iframe width="560" height="315" src="https://www.youtube.com/embed/lIpLIfPUmWg" frameborder="0" allowFullScreen></iframe>\n</div>\n<p>Speaking of droids here\'s the guts of a BB8 Sphero:</p>\n<div class="post-images">\n  <a href="Dalek.jpg">\n  <a class="gatsby-resp-image-link" href="/static/Dalek_sm-f8c23d1821a80fa913a1f168e5b1893d-f8e2c.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 225px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Dalek" title="" src="/static/Dalek_sm-f8c23d1821a80fa913a1f168e5b1893d-f8e2c.jpg" srcset="/static/Dalek_sm-f8c23d1821a80fa913a1f168e5b1893d-1e460.jpg 163w,\n/static/Dalek_sm-f8c23d1821a80fa913a1f168e5b1893d-f8e2c.jpg 225w" sizes="(max-width: 225px) 100vw, 225px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n  <a href="bb8_disassembled.jpg">\n  <a class="gatsby-resp-image-link" href="/static/bb8_disassembled_sm-d90e79bb5cc941a98a0edc2dfe1b7fe1-d5f0e.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="bb8 disassembled" title="" src="/static/bb8_disassembled_sm-d90e79bb5cc941a98a0edc2dfe1b7fe1-d5f0e.jpg" srcset="/static/bb8_disassembled_sm-d90e79bb5cc941a98a0edc2dfe1b7fe1-a0a20.jpg 163w,\n/static/bb8_disassembled_sm-d90e79bb5cc941a98a0edc2dfe1b7fe1-d5f0e.jpg 300w" sizes="(max-width: 300px) 100vw, 300px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n</div>\n<p>How about a Lego machine that folds paper airplanes and then launches them? There\'s Devin standing in front a giant sculpture made of tape and a T-Rex made of cardboard covered in EL-Wire.</p>\n<div class="post-images">\n  <a href="lego_paper_airplane_builder.jpg">\n  <a class="gatsby-resp-image-link" href="/static/lego_paper_airplane_builder_sm-55bbe6c6223debe2193ceaada7470c9f-d5f0e.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="lego paper airplane builder" title="" src="/static/lego_paper_airplane_builder_sm-55bbe6c6223debe2193ceaada7470c9f-d5f0e.jpg" srcset="/static/lego_paper_airplane_builder_sm-55bbe6c6223debe2193ceaada7470c9f-a0a20.jpg 163w,\n/static/lego_paper_airplane_builder_sm-55bbe6c6223debe2193ceaada7470c9f-d5f0e.jpg 300w" sizes="(max-width: 300px) 100vw, 300px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n  <a href="Devin_with_Tapigami.jpg">\n  <a class="gatsby-resp-image-link" href="/static/Devin_with_Tapigami_sm-787e713f3b764a085921f3ac5d99d6fb-d5f0e.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Devin with Tapigami" title="" src="/static/Devin_with_Tapigami_sm-787e713f3b764a085921f3ac5d99d6fb-d5f0e.jpg" srcset="/static/Devin_with_Tapigami_sm-787e713f3b764a085921f3ac5d99d6fb-a0a20.jpg 163w,\n/static/Devin_with_Tapigami_sm-787e713f3b764a085921f3ac5d99d6fb-d5f0e.jpg 300w" sizes="(max-width: 300px) 100vw, 300px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n  <a href="cardboard_t-rex.jpg">\n  <a class="gatsby-resp-image-link" href="/static/cardboard_t-rex_sm-6085c16b7595cc069d6b189cf3417cff-d5f0e.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="cardboard t-rex" title="" src="/static/cardboard_t-rex_sm-6085c16b7595cc069d6b189cf3417cff-d5f0e.jpg" srcset="/static/cardboard_t-rex_sm-6085c16b7595cc069d6b189cf3417cff-a0a20.jpg 163w,\n/static/cardboard_t-rex_sm-6085c16b7595cc069d6b189cf3417cff-d5f0e.jpg 300w" sizes="(max-width: 300px) 100vw, 300px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n</div>\n<p>Devin building an LED flashlight out of a popsicle stick, and LED and some conductive tape.</p>\n<div class="post-images">\n  <a href="LED_Flashlight.jpg">\n  <a class="gatsby-resp-image-link" href="/static/LED_Flashlight_sm-e63e225eec41017013488af7a8814637-d5f0e.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="LED Flashlight" title="" src="/static/LED_Flashlight_sm-e63e225eec41017013488af7a8814637-d5f0e.jpg" srcset="/static/LED_Flashlight_sm-e63e225eec41017013488af7a8814637-a0a20.jpg 163w,\n/static/LED_Flashlight_sm-e63e225eec41017013488af7a8814637-d5f0e.jpg 300w" sizes="(max-width: 300px) 100vw, 300px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n</div>\n<p>Pancakes?</p>\n<div class="post-images">\n  <a href="pancake_printer.jpg">\n  <a class="gatsby-resp-image-link" href="/static/pancake_printer_sm-5ffaccb63d22cb5a76347746c806fa17-d5f0e.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="pancake printer" title="" src="/static/pancake_printer_sm-5ffaccb63d22cb5a76347746c806fa17-d5f0e.jpg" srcset="/static/pancake_printer_sm-5ffaccb63d22cb5a76347746c806fa17-a0a20.jpg 163w,\n/static/pancake_printer_sm-5ffaccb63d22cb5a76347746c806fa17-d5f0e.jpg 300w" sizes="(max-width: 300px) 100vw, 300px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n</div>\n<p>Everyone needs a motorcycle that looks like a dragon:</p>\n<div class="post-images">\n  <a href="dragon_cycle.jpg">\n  <a class="gatsby-resp-image-link" href="/static/dragon_cycle_sm-3845d2b94369564e91466378bb055ada-d5f0e.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="dragon cycle" title="" src="/static/dragon_cycle_sm-3845d2b94369564e91466378bb055ada-d5f0e.jpg" srcset="/static/dragon_cycle_sm-3845d2b94369564e91466378bb055ada-a0a20.jpg 163w,\n/static/dragon_cycle_sm-3845d2b94369564e91466378bb055ada-d5f0e.jpg 300w" sizes="(max-width: 300px) 100vw, 300px">\n    </span>\n  </span>\n  \n  </a>\n    </a>\n</div>\n<p>EepyBird was on hand to cover the audience in Coke:</p>\n<div class="post-images">\n  <iframe width="560" height="315" src="https://www.youtube.com/embed/54-jSaVQABA" frameborder="0" allowFullScreen></iframe>\n</div>\n<p>Oh and there was also free Haagen-Dazs ice cream. Any event with free ice cream is a bit of awesome.</p>',frontmatter:{title:"Maker Faire",date:"May 21, 2016",imageUrl:null,image:{childImageSharp:{sizes:{src:"/static/bb8_disassembled-484e63fb8108aa7d1a76e301993f05f8-381d6.jpg"}}}}}},pathContext:{path:"/maker-faire"}}}});
